import React, { Component } from "react";
import forkliftLogo from "../images/forklift-logo.png";
import { useState } from "react";

export class Inspect extends React.Component {
  constructor(props) {
    super(props);
    this.stage = { currentPage: "inspect" };
  }
  render() {
    return (
      <div>
        <div id="navbar-container">
          <nav>
            <a className="active">
              <button
                id="inspect-page"
                onClick={() => setCurrentPage("inspect")}
              >
                Inspect
              </button>
            </a>
            <a>
              <button id="safety-page" onClick={() => setCurrentPage("safety")}>
                Safety
              </button>
            </a>
            <a>
              <button
                id="contact-page"
                onClick={() => setCurrentPage("contact")}
              >
                Contact
              </button>
            </a>
          </nav>
        </div>
        <div>
          <button id="inspect-button">INSPECT</button>
        </div>
        <div id="forklift-logo">
          <img src={forkliftLogo} alt="Forklift logo" />
        </div>
      </div>
    );
  }
}
